import { Form, Button } from 'semantic-ui-react';
import Layout from '../../components/Layout';

export default class CampaignNew extends Component {
  render() {
    return (
      <Layout>
        <h1>New campaign!</h1>

        <Form>
          <Form.Field>
            <label>Minimum Contribution</label>
            <input />
          </Form.Field>
        </Form>
      </Layout>
    )
  }
}
